import TopLeft from "../containers/TopLeft";
import TopMid from "../containers/TopMid";
import TopRight from "../containers/TopRight";
import News from "../containers/News";
import HealthMetrics from "../containers/HealthMetrics";
import PopUp from "../containers/PopUp";
import BreathingEx from "../containers/BreathingEx";
import React, { useState } from "react";

export default function AddNumberRoot(){
    const [ isPopUp, setPopup ] = useState(true);
    const [ isBreathing, setBreathing ] = useState(true);
      return (
        <div>
            {isBreathing ? <BreathingEx onCloseRec={setBreathing} /> : null}

            <div className="absolute centering-all z-index-zero">
            {isPopUp ? <PopUp onClose={setPopup} /> : null}
            </div>
            <div className="flex">
                <div className="c-19 displayNone"><TopLeft/></div>
                <div className="c-62"><TopMid/></div>
                <div className="c-19 displayNone"><TopRight/></div>
            </div>
            <div className="flex">
                <div className="c-100"><News/></div>
            </div>
            <div className="flex">
                <HealthMetrics/>
            </div>
        </div>

      )
  }
